import React from "react";
import Button from "./Button";

export default class Dashboard extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  // Variables
  renderPlusOneButton;

  // Functions
  componentDidMount() {
    if (this.props.lastPack != "") {
      alert(this.props.lastPack);
      this.renderPlusOneButton = true;
    } else {
      this.renderPlusOneButton = false;
    }
  }

  render() {
    return (
      <div>
        {this.renderPlusOneButton == true
        ?<Button>+1 from last {`(` + this.lastPack + `)`}</Button>
        :<div></div>
        }


        <Button>Choose active pack</Button>
        <Button>Add new pack</Button>
      </div>
    );
  }
}
